// src/types/pokemon.ts

// Basic Pokemon type for list view
export interface Pokemon {
  id: string;
  name: string;
  url: string;
  image: string;
}

// API response for Pokemon list
export interface PokemonListResponse {
  count: number;
  next: string | null;
  previous: string | null;
  results: Pokemon[];
}

// Pokemon ability interface
export interface Ability {
  ability: {
    name: string;
    url: string;
  };
  is_hidden: boolean;
  slot: number;
}

// Pokemon stat interface
export interface Stat {
  base_stat: number;
  effort: number;
  stat: {
    name: string;
    url: string;
  };
}

// Pokemon type interface
export interface Type {
  slot: number;
  type: {
    name: string;
    url: string;
  };
}

// Pokemon move interface
export interface Move {
  move: {
    name: string;
    url: string;
  };
  version_group_details: {
    level_learned_at: number;
    move_learn_method: {
      name: string;
      url: string;
    };
    version_group: {
      name: string;
      url: string;
    };
  }[];
}

// Pokemon sprite interface
export interface Sprites {
  front_default: string;
  back_default: string;
  front_shiny: string;
  back_shiny: string;
  other: {
    "official-artwork": {
      front_default: string;
    };
  };
}

// Detailed Pokemon information
export interface PokemonDetail {
  id: number;
  name: string;
  base_experience: number;
  height: number;
  weight: number;
  abilities: Ability[];
  stats: Stat[];
  types: Type[];
  moves: Move[];
  sprites: Sprites;
  species: {
    name: string;
    url: string;
  };
}
